  app.directive('iFile', [
    '$interval',
    'isite',
    '$timeout',
    function ($interval, isite, $timeout) {
      return {
        restrict: 'E',
        required: 'ngModel',
        scope: {
          label: '@',
          view: '@',
          accept: '@',
          folder: '@',
          ngModel: '=',
          ngClick: '&',
          onSelected: '&',
          ngChange: '&',
        },
        link: function ($scope, element, attrs, ctrl) {
          $scope.label = $scope.label || '';
          $scope.folder = $scope.folder || 'default';
          $scope.accept = $scope.accept ? $scope.accept : '';
          $scope.viewOnly = $scope.view === undefined ? false : true;
  
          let input = $(element).find('input')[0];
          let button = $(element).find('i-button')[0];
  
          let progress = $(element).find('.progress')[0];
          let progressBar = $(element).find('.progress-bar')[0];
          $(progress).hide();
  
          $scope.id = Math.random().toString().replace('.', '_');
  
          if (!$scope.viewOnly) {
            button.addEventListener('click', function () {
              input.click();
            });
          }
  
          input.addEventListener('change', function () {
            isite.uploadFile(
              this.files,
              {
                folder: $scope.folder,
              },
              (err, file, e) => {
                if (e) {
                  $(progress).show();
                  $scope.value = (e.loaded / e.total) * 100;
                  progressBar.style.width = $scope.value + '%';
                  $scope.max = e.total;
                  if ($scope.value === 100) {
                    $(progress).hide();
                  }
                }
  
                if (file) {
                  $scope.ngModel = file;
                  $scope.changed();
                }
              }
            );
            $scope.ngModel = this.files[0].path;
            $scope.onSelected(this.files[0].path);
            $scope.$applyAsync();
          });
  
          $scope.$watch('ngModel', (ngModel) => {
            if (ngModel) {
              button.setAttribute('url', ngModel);
            }
          });
  
          $scope.changed = function () {
            $timeout(() => {
              if ($scope.ngChange) {
                $scope.ngChange();
              }
            }, 200);
          };
        },
        template: `<div class="row">
    <label class="col"> {{label}} </label>
    <i-button type="upload" ng-hide="ngModel || viewOnly" class="col"></i-button>
  
    <div class="row">
      <input class="hidden" type="file" name="fileToUpload" accept="{{accept}}">
      <div class="progress row">
        <div class="progress-bar progress-bar-striped progress-bar-animated" role="progressbar" aria-valuenow="{{value}}" aria-valuemin="0" aria-valuemax="100"></div>
      </div>
    </div>
  
    <div class="view" ng-show="ngModel">
      <a class="link" href="{{ngModel.url}}"> {{ngModel.name}} </a> <span class="blue"> [ size {{ngModel.size / 1000}} kb ] </span>
      <i-button ng-hide="viewOnly" type="delete default" ng-click="ngModel = null;changed();"></i-button>
    </div>
  </div>
  `,
      };
    },
  ]);
  
